      "text" : "!3Q6! {S}{*TC:2000|8000}It’s been just over an hour since a little girl was taken hostage on the top floor of a building here in downtown Detroit.{*TC:8500|10850}Details are still emerging on what exactly happened,{*TC:11000|13600}but the hostage taker could be the family’s android.{*TC:14000|18000}He may have taken the lives of at least one family member and a police officer…{*TC:18300|23000}If confirmed, this would be the first case of an android deliberately taking human lives. {*TC:23400|27300}By all signs, the SWAT team are preparing for an assault and-",
      "hasLink" : true,
