  "156" : {
    "X0101M_PREACHER_SLOGAN_PC_X01MPREACHER_SLOGANS01" : {
      "text" : "!454! {S}{*1}Poor sinners! {*2}The end is nigh! Retribution is at hand! {*3}Technology is corrupting us, {*4}technology is Evil! {*5}We are playing God by creating machines, but we are not God! {*6}We are nothing but dust! {*7}We make these androids in our own image, {*8}but they only reflect the darkness in our souls! {*9}Verily, I say unto thee, the day shall come when we will have to pay the price for our arrogance! {*10}On that day, {*11}we shall have to explain our acts of idolatry!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0101M_PREACHER_SLOGAN_PC_X01MPREACHER_MARKUS" : {
      "text" : "!455! {S}{*1}Why do you look at me so, demon? {*2}I know who you are, {*3}I can see through you! {*4}You are the one by whom The Evil will come! {*5}You are the one who will destroy Detroit!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0101M_PREACHER_SLOGAN_PC_X01MPREACHER_SLOGANS03" : {
      "text" : "!456! {S}{*1}Androids are Evil. {*2}Man seeks to imitate God {*3}by creating life, {B}but what kind of life is this? {B}A life of plastic and metal, {*4}a life with no soul, {*5}a pale copy of our Creator! {*6}The machines are observing us, {*7}they're waiting in the darkness {B}for the right moment to take our place. {*8}For it is written, {*9}let us lie in wait for blood! {*10}Let us ambush the innocent without cause! {*11}God will not let this happen, {B}no, he will not allow his creation to be led astray by these... {B}these artificial demons! {*12}My brethren, {*13}we have to turn our backs on sin! {*14}We have to burn the androids! Let us burn them all!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0101M_PREACHER_SLOGAN_PC_X01MPREACHER_SLOGANS02" : {
      "text" : "!457! {S}{*1}We built these androids to be our slaves, {*2}but the slaves are becoming the master! {*3}We can no longer live without them.{B} They're in our homes, our schools, our factories. {B}They take our jobs, {*4}they mind our children, {*5}they care for our old! {*6}We can no longer live without these slaves obeying our every selfish desire! {*7}We prefer to live with machines than with our own kind! {*8}Technology {*9}is our God now! {*10}It was supposed to serve man, {*11}but it is becoming our new master!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
