  "2358" : {
    "X0302C_TV_NEWS_PC_X03CBRINKLEY_CARLOSUPDATE" : {
      "text" : "!541! {S}{*1}Several sources report that CyberLife has provided Detroit Police with a prototype detective android.{*2}Although police assistant androids have existed for several years now, this would be the first case of an android being authorized to play an active role in criminal investigations.{*3}We contacted CyberLife for comment {B}but no one was available to answer our questions.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0302C_TV_NEWS_PC_X03CBRINKLEY_RUSSIANCONFLIT" : {
      "text" : "!542! {S}{*1}Tensions in the Arctic have reached a new level, with a Russian carrier and an American patrol boat reported to have clashed last night.{*2}Several warning shots were exchanged, apparently with no damage or casualties to either side.{*3}The Minister for Defense, Denis Riggs, has spoken of \"intolerable provocation that cannot go unanswered\".{*4}The countries in the region, particularly Sweden and Canada,{*5}have called for military forces to withdraw and an international conference to be held.{*6}So far, there has been no response from either Moscow or Washington.{*7}We’ll keep you informed minute by minute as the situation develops.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0302C_TV_NEWS_PC_X03CCARTLAND_AIAUTHOR" : {
      "text" : "!543! {S}{*1}The first book written by an artificial intelligence has just been published and to call it a success would be an understatement –{B}Do Humans Dream of Mammalian Sheep? has shot to the top of the bestseller list.{*2}Moreover, critics are unanimous in their praise for the depth of thought and originality of this first work.\r\n{*3}Designed by CyberLife, the AI known as VOLTAIRE analyzed human centers of interest on social networks for several months before its complex algorithms generated the plot of the novel.\r\n{*4}According to several specialists, it will be very difficult for human authors to compete with these algorithms and the odds are that most of the books written in the coming years will be the work of artificial intelligence.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0302C_TV_NEWS_PC_X03CWEBB_CARLOSUPDATEWEBB" : {
      "text" : "!544! {S}{*1}Detroit Police found the body of thirty-year-old Carlos Ortiz in his home last night, following calls from concerned neighbors.{B}Known to the police as a petty criminal, Mr. Ortiz is reported to have suffered from a psychiatric condition and rarely left his apartment.{*2}He is thought to have died several weeks ago.{*3}The police are conducting forensic tests but appear to be treating the death as a homicide.{*4}The victim's android is also reported missing.{*5}We’ll bring you more on that story as it develops.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
