  "735" : {
    "X0401K_TV_TODDONTV_PC_X04KJOSS_TODDDEAD01" : {
      "text" : "!5VX! {S}{*1}The victim’s name was Todd Williams, an unemployed man from Corktown.{*2}According to initial reports, he was shot by his android, an AX400.{*3}The android fled the scene and a police search is now in progress.{B}Reporting live for Channel 16 News, I'm Joss Douglas. ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0401K_TV_TODDONTV_PC_X04KJOSS_TODDALIVE01A" : {
      "text" : "!5VY! {S}{*1}Thanks, Michael. I’m joined by Corktown resident Todd Williams, who was violently attacked by his AX400 around 11 PM last night. {*2}Todd, can you tell us what happened?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0401K_TV_TODDONTV_PC_X04KDAD_TODDALIVE01T" : {
      "text" : "!5VZ! {S}{*1}I was having dinner, I was minding my own business.{*2}Damn thing jumped on me.{*3}Managed to defend myself, but it went crazy. I thought it was gonna kill me...{*4}So I fought it off, but it ran away.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0401K_TV_TODDONTV_PC_X04KJOSS_TODDALIVE01B" : {
      "text" : "!5W0! {S}{*1}Thank you, Todd. {*2}Disturbing news for android owners everywhere. {*3}Police have launched a search to find the android. {*4}Let's hope they find it fast.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
