      "text" : "!6KP! {S}{*TC:0|1040}That's enough. Let her go!{*TC:2760|4760}Zlatko is dead. He won't give you any more orders!{*TC:6080|9080}You're no longer his slave. You can decide for yourself who you want to be.",
