  "2360" : {
    "X0502K_TV_NEWS_PC_X05KWEBB_SUPERMARKETROBBER01" : {
      "text" : "!6LB! {S}{*1}A Detroit supermarket was held up at gunpoint last night. The cashier reports that he was attacked by an android in the company of a little girl.{*2}Now, if these reports are confirmed, it would be the first case of an android conducting an armed robbery.{*3}Police have not ruled out the possibility that the culprit is the same AX400 that was reported missing this morning.{*4}A search is underway for the missing model.{*5}And now for some other headlines-",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0502K_TV_NEWS_PC_X05KWEBB_SUPERMARKETROBBER02" : {
      "text" : "!6LC! {S}{*1}A Detroit supermarket was held up at gunpoint last night. The cashier reports that he was attacked by a young woman in the company of a little girl.{*2}The police have not ruled out the possibility of the culprit being the AX400 model that was reported missing this morning.{*3}If these reports are confirmed, it would be the first case of an android being directly involved in an armed attack.{*4}The police are currently on the lookout for the missing model.{*5}And now for some other headlines-",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0502K_TV_NEWS_PC_X05KWEBB_HIGHWAYNEWS" : {
      "text" : "!6LD! {S}{*1}Detroit residents were disturbed by a surprising chase through the city's streets this morning. According to several witnesses, a young woman and a little girl were trying to escape from the police, though we still don’t know why.{*2}The chase is reported to have ended on a freeway, where the two fugitives risked their lives to cross the traffic.{*3}No one is able to say for sure whether they survived.{*4}Further unconfirmed reports suggest the fugitives were two defective androids on the run.{*5}The police have refused to comment for the moment.{*6}And now for some other headlines-",
      "hasLink" : true,
      "linkExists" : true
    }
  },
