  "777" : {
    "X0603C_TRACKGAME_WITNESS01_PC_X06CCONNOR_START" : {
      "text" : "!78D! {S}{*1}Can you rent this Traci?{*2}Please, Lieutenant!{*3}Just trust me.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_PC_X06CHANK_START" : {
      "text" : "!78E! {S}{*1}For fuck's sake, Connor, we got better things to do…{*4}This is not gonna look good on my expense account…{*5}Yeah, you're welcome.{*6}Ok, now what?{*7}Holy shit, Connor...{*8}What the hell are you doin'?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_PC_X06CCONNOR_END" : {
      "text" : "!78F! {S}{*1}It saw something. {*2}The deviant leave the room…{*3}A blue-haired Traci. \r\n{*4}Club policy is to wipe the androids’ memory every two hours.{*5}We only have a few minutes if we wanna find another witness!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_PC_X06CHANK_END" : {
      "text" : "!78G! {S}{*1}What are you talkin' about? Saw, what?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_FA_X06CANDWOMCABIN01_STARTTRACI" : {
      "text" : "!78H! {S}{*1}Delighted to meet you.{*2}Follow me,{*3}I’ll take you to your room.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_VO_X06CBOXVOICE_START02" : {
      "text" : "!78I! {S}{*1}Purchase confirmed.{*2}Eden Club wishes you a pleasant experience.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01_VO_X06CBOXVOICE_START01" : {
      "text" : "!78J! {S}{*1}Hello. A 30 minute session costs $29.99. Please confirm your purchase.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "783" : {
    "X0603C_FINAL_GAMEOVERS_PC_X06CHANK_TIMER" : {
      "text" : "!78K! {S}{*1}Come on, Connor!{*2}We're leaving.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_GAMEOVERS_PC_X06CCONNOR_LEAVE" : {
      "text" : "!78L! {S}{*1}I failed.{*2}I should have caught it…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_GAMEOVERS_PC_X06CHANK_LEAVE" : {
      "text" : "!78M! {S}{*TC:8005|9167}Let's get outta here.{*TC:9819|11462}This place makes me sick…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_GAMEOVERS_PC_CHOICEGROUP_LEAVE" : {
      "text" : "!78N! LEAVE",
      "hasLink" : false,
      "linkExists" : false
    }
  },
  "778" : {
    "X0603C_TRACKGAME_WITNESS01FINISH_FA_X06CCONNOR_MOVIE" : {
      "text" : "!78O! {S}{*1}Tell it you changed your mind! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS01FINISH_PC_X06CHANK_MOVIE" : {
      "text" : "!78P! {S}{*1}Hey, what am I supposed to do with this one?{*2}Uhh... Sorry, honey, changed my mind!{*3}Nothing personal, you're... a lovely girl... I just, uh...{*4}You know...{*5}I'm with him and...{*6}I mean, not with him like that... I'm not that... That's not what I... {*7}You, um...{*8}Wow...{*9}I just... ...{*10}got a job to do. {*TC:34250|35202}My head-",
      "hasLink" : true,
      "linkExists" : true
    }
  },
