  "785" : {
    "X0603C_FINAL_HANKCLOSEUP_PC_X06CHANK_MOVIE" : {
      "text" : "!7AQ! {S}{*1}Oh, shit!",
      "hasLink" : true,
      "linkExists" : false
    }
  },
  "791" : {
    "X0603C_FINAL_HANKFAIL_FA_X06CHANK_MOVIE" : {
      "text" : "!7AR! {S}{*1}DON'T MOVE!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "789" : {
    "X0603C_TRACKGAME_BADCHOICEFINISH_FA_X06CCONNOR_WRONG01" : {
      "text" : "!7AS! {S}{*1}It didn’t see anything.{*2}I made a mistake somewhere…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_BADCHOICEFINISH_FA_X06CCONNOR_WRONG02" : {
      "text" : "!7AT! {S}{*1}Nothing… {*2}Blue-haired Traci didn't come this way…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_BADCHOICEFINISH_FA_X06CCONNOR_WRONG03" : {
      "text" : "!7AU! {S}{*1}No…{*2}I lost its track again...",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_BADCHOICEFINISH_FA_X06CHANK_MONEY01" : {
      "text" : "!7AV! {S}{*1}I’ve spent all this money and I’m still not havin' fun…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_BADCHOICEFINISH_FA_X06CHANK_MONEY02" : {
      "text" : "!7AW! {S}{*1}This has gotta be the most expensive investigation of my career!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "780" : {
    "X0603C_TRACKGAME_WITNESS02FINISH_FA_X06CCONNOR_MOVIE" : {
      "text" : "!7AX! {S}{*1}It saw the blue-haired Traci, I know which way it went!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS02FINISH_FA_X06CHANK_GOAHEAD" : {
      "text" : "!7AY! {S}{*1}Then go for it!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "782" : {
    "X0603C_TRACKGAME_WITNESS03FINISH_FA_X06CCONNOR_MOVIE" : {
      "text" : "!7AZ! {S}{*1}I know where it went! Follow me!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_WITNESS03FINISH_FA_X06CHANK_CRAZY" : {
      "text" : "!7B0! {S}{*1}Fucking-A. This is crazy…",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "1883" : {
    "X0603C_TRACKGAME_REACTION_FA_X06CHANK_REACT01" : {
      "text" : "!7B1! {S}{*1}You’re really reading their memories, to see what they saw?{*2}Fuck, this is insane…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_REACTION_FA_X06CHANK_REACT02" : {
      "text" : "!7B2! {S}{*1}Connor, wait for me for God’s sake!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_REACTION_FA_X06CCONNOR_REACT03" : {
      "text" : "!7B3! {S}{*1}I know which direction it took. I just need to find another android on its path!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_REACTION_FA_X06CCONNOR_REACT04" : {
      "text" : "!7B4! {S}{*1}Lieutenant, if you have a better idea, I’m all ears.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_REACTION_FA_X06CHANK_REACT03H" : {
      "text" : "!7B5! {S}{*1}There're androids everywhere! How you gonna tell which one saw the Traci with blue hair?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_REACTION_FA_X06CHANK_REACT04H" : {
      "text" : "!7B6! {S}{*1}We’ll never have time to check 'em all!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "787" : {
    "X0603C_TRACKGAME_BADCHOICE_FA_X06CCONNOR_MOVIE" : {
      "text" : "!7B7! {S}{*1}Let’s try this one.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_TRACKGAME_BADCHOICE_FA_X06CHANK_MOVIE" : {
      "text" : "!7B8! {S}{*1}This better be worth it!  ",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "779" : {
    "X0603C_FINAL_HANKAGENDA_FA_X06CHANK_MOVIE" : {
      "text" : "!7B9! {S}{*1}People are fucking insane… They don’t want relationships anymore, everybody just gets an android…{*2}They cook what you want, they screw when you want, you don't have to worry about how they feel…{B}Next thing you know, we’re gonna be extinct, because everybody would rather buy a piece of plastic than love another human being…{*3}Beats me…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_HANKAGENDA_FA_X06CHANK_TOOLATE" : {
      "text" : "!7BA! {S}{*1}Shit… We're too late…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_HANKAGENDA_FA_X06CHANK_TOSSOUT" : {
      "text" : "!7BB! {S}{*1}Christ, look at them… {*2}They get used till they break, then they get tossed out…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0603C_FINAL_HANKAGENDA_FA_X06CHANK_GONE" : {
      "text" : "!7BC! {S}{*1}They’re gone, Connor. We’d better go.",
      "hasLink" : true,
      "linkExists" : false
    },
    "X0603C_FINAL_HANKAGENDA_FA_X06CHANK_GONE02" : {
      "text" : "!7BD! {S}{*1}You coming?",
      "hasLink" : true,
      "linkExists" : false
    }
  },
  "781" : {
    "X0603C_FINAL_HANKAGENDAFINISH_FA_X06CCONNOR_COMING" : {
      "text" : "!7BE! {S}{*1}Yes,{*2}I’m coming.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
