    "X0701K_CHASE_FINALCHOICE_PC_X07KKARA_READY" : {
      "text" : "!7ON! ",
      "hasLink" : true,
      "linkExists" : false
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KALICE_READY" : {
      "text" : "!7OO! {S}{*1}What are you doing, Kara?! They'll kill you!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KKARA_CONFRONT" : {
      "text" : "!7OP! {S}{*1}No! Don't shoot! Don't shoot!\r\n",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KALICE_CONFRONT" : {
      "text" : "!7OQ! {S}{*1}KARA!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KKARA_PROTECT" : {
      "text" : "!7OR! {S}{*1}Stop! Stop, don't shoot!\r\n{*2}I'm… I'm not an android! I'm human!..{*3}See?{*4}I don't have an LED...\r\n{*5}Why are you doing this?..\r\n{*6}Go away!{*7}Are you alright?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KLUTHER_PROTECT" : {
      "text" : "!7OS! {S}{*5}Yeah,{*6}I think so.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KKARA_FREEZE02" : {
      "text" : "!7OT! {S}{*1}Humans...{*2}Having a little fun…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KALICE_FREEZE02" : {
      "text" : "!7OU! {S}{*1}LUTHER!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KLUTHER_FREEZE02" : {
      "text" : "!7OV! {S}{*3}Who were those guys?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KBADBOY01_FREEZE01BADBOY" : {
      "text" : "!7OW! {S}{*5}What are you? {*6}You're not a Jerry…{*7}Ha! Ha! Ha! See, guys? This one thinks it can give me orders…{*9}No... No, wait... wait a minute… {*10}Don’t… don't kill me… {*11}We weren't doing anything wrong! {*12}We... we just came here for a bit of fun… {*13}You know, come on, shooting practice with my buddies… {*14}They... {*15}they… they’re just machines… {*16}Ok, ok... {*17}ok... {*18}I'm going away, don't shoot...",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0701K_CHASE_FINALCHOICE_PC_X07KBADBOY01_PROTECTBADBOY" : {
      "text" : "!7OX! {S}{*2}Shit, where'd you come from?.. {*3}You a new model or what?{*4}What… {*5}what are you doing here?... {*6}It's dangerous! {*7}We could've shot you!{*8}Just for fun… {*9}We come here from time to time to get some target practice… {*10}They're just old androids… {*11}It don't bother no one… {*13}Ok… {*15}Come on, guys. Let's get outta here.",
      "hasLink" : true,
      "linkExists" : true
    },
