  "2517" : {
    "X5072X_VOICE_PROGRAMS_VO_MANAWI_WEATHER1" : {
      "text" : "!8DJ! {S}{*1}Right on schedule, a potent Arctic cold front is crossing southeast Detroit. Temperatures ahead of the front, boosted by southwest winds, have reached the mid to upper 40s. Once the front passes by, your winds will shift to the northwest, gust up to or above 30 mph, temperatures will immediately plunge, and we’ll already be in the 20s by this evening.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X5072X_VOICE_PROGRAMS_VO_MANAWI_WEATHER2" : {
      "text" : "!8DK! {S}{*1}Skies will clear overnight, with lows near 20 degrees in our Downtown Island, and in the upper tens in the more rural areas away from the city. Northwest wind should diminish to 10-15 mph. {*2}Mostly sunny for MOST of us on after that, with highs in the upper 20s to near 30 degrees. North wind at 5 to 10 mph. One thing I continue to monitor is the potential for some lake effect snow showers off of the Lake for the eastern Gaffer region. {*3}Where these bands set up is directly the result of the exact wind trajectory over the lake, and this day’s north wind may be enough to bring a few bands inland. {*4}At this point, I don’t expect any high-impact weather from this, but it is still something to keep in mind for those of you up that way. ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X5072X_VOICE_PROGRAMS_VO_MANLCL_WARREN" : {
      "text" : "!8DL! {S}{*1}Barely a year after her election, {*2}President Warren is having a bumpy start to her term. {*3}After rising to prominence as a vlogger, Warren has no experience in government and relied on social media and celebrity to secure election. {*4}Now, with her camp in disarray, even her allies are beginning to wonder how she will manage after several months of calamitous political failures. {*5}Mired in accusations that she is too close to big business, {B}Warren is under investigation to determine whether or not she has benefited from CyberLife's help in obtaining compromising information about her opponent during the presidential campaign. {*6}In this poisonous climate, the former celebrity must deal with the highest unemployment rate in American history {B}whilst facing the United States’ greatest threat in recent decades. {*7}The conflict in the Arctic threatens to dislodge world peace, {*8}leaving concerned that President Warren is the one tasked with finding a solution...",
      "hasLink" : true,
      "linkExists" : true
    },
    "X5072X_VOICE_PROGRAMS_VO_MANORA_ANDROIDSPY" : {
      "text" : "!8DM! {S}{*1}More and more experts are suggesting that CyberLife uses its 120 million androids to record details of private conversations of its customers and sell them to trading partners. {*2}Ever talked about buying that new car while eating dinner with your partner? {*3}CyberLife could use that information for targeted advertising. {*4}The information goldmine doesn’t stop there – everything from personal indiscretions to political affiliations could easily be extracted, and potentially used for nefarious purposes. {*5}The spate of reports linking Warren’s Presidency to CyberLife only deepens such concerns. {*6}Several consumer rights organizations have requested that CyberLife disclose the information it gathers and to who it sells that information to, but the company has always refused, {B}whilst assuring it respects the privacy of its customers. {*7}But CyberLife has access to the most intimate details about those customers. {*8}Requests for a formal inquiry have gone unanswered - so far. ",
      "hasLink" : true,
      "linkExists" : false
    },
    "X5072X_VOICE_PROGRAMS_VO_MANDCO_REDICE" : {
      "text" : "!8DN! {S}{*1}The synthetic stimulant informally known as ‘red ice’ has become the drug of choice for Detroit’s growing underclass. Analysts have pointed to Detroit’s status as the epicenter of android production, suggesting the drug flourishes in the dissatisfaction caused by androids taking human jobs. {*2}Sociologist Dr Julian Carter has drawn the same link with androids: {*3}“As CyberLife’s androids spread across the country, they will bring red ice with them. Poor men and women, desperate to make ends meet, are vulnerable to become users – or even dealers.” {*4}Not only is the popularity of this drug spreading rapidly, {*5}but its chemical composition is uniquely dangerous. {*6}Thirium, the main ingredient in android ‘blue blood’, is among the activate agents in red ice and has a highly destabilizing effect on hormone production. {*7}The National Council on Narcotics say the problem is going to get worse stating: “the purity of ingredients is very low and deteriorating”. {*8}Users are likely to “consumer higher and higher quantities as they chase the high”. {*9}This may be way the market is fast becoming Americas’ biggest narcotics industry, {*10}and is only likely to grow. Red ice dealers are reported to have an unofficial motto: “Where the blood is blue, the ice is red… {*11}and the money is green”. {*12}We'll be right back after the break, {*13}with more news.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X5072X_VOICE_PROGRAMS_VO_WOMLKE_TIPPINGPOINT" : {
      "text" : "!8DO! {S}{*1}Global rainforests have been reduced by 79% since 2000, and coastal corals by 58%. {*2}Polar ice has melted to such an extent that rising sea levels are making it a struggle to keep water out of coastal towns. {*3}With these ‘cooling factors’ so diminished, there is now too much carbon in the atmosphere for the environment to ever absorb. {*4}Jason Reese, head of the Global Environment Agency, said: “this study confirms what many of us have suspected for a long time – but the real calamity is the linked decline of natural resources, from energies to minerals, which are almost exhausted and can never be replaced”. {*5}Many environmentalists have criticized Reese’s comments, suggesting that they will discourage people from taking action. But Reese has defied these criticisms: “It’s important people accept the reality of the situation. The planet will keep getting hotter now. The only question is, how fast?”",
      "hasLink" : true,
      "linkExists" : true
    }
  },
