  "1106" : {
    "X0801K_HOUSE_UPSET_PC_X08KADAM_UPSET" : {
      "text" : "!8DU! {S}{*1}We can't hide them!{*2}Not after what those deviants did today!{*3}It's too dangerous!{*4}Do you know what'll happen if the police find them here?{*5}We'll go to prison, Mom!{*6}Do you understand me?{*7}Prison!{*8}No!{*9}I won't back down this time!{*10}You're gonna ruin our lives, and for what?{*11}For a bunch of machines?{*12}I'm alive! You are alive! They!..{*13}They're nothing!{*14}And none of this would be happening if dad was still here!{*15}I'm not going to prison because you wanna help these freaks!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0801K_HOUSE_UPSET_PC_X08KROSE_UPSET" : {
      "text" : "!8DV! {S}{*1}Adam, we’ve already talked about this!{*2}They're not machines! They're alive!{*3}I will not stand for that kind of talk!{*4}THAT IS ENOUGH ADAM! THAT'S ENOUGH!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
