      "text" : "!9CJ! {S}{*1}Okay…{*2}I'm ok…{*3}I was connected to its memory…{*4}when it fired…{*5}I felt it die…{*6}Like I was dying.{*7}I was scared…{*8}I saw something,{*9}in its memory…{*10}a word…{*11}painted on a piece of rusty metal …{*12}\"Jericho\"",
