  "1750" : {
    "X0201A_INSIDE_INTRO_FA_X02AKARA_WARMPLACE" : {
      "text" : "!ACF! {S}{*1}We've got to find a warm place for Alice.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02AKARA_HOWYOUFEEL" : {
      "text" : "!ACG! {S}{*1}How do you feel?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02AALICE_HOWYOUFEEL" : {
      "text" : "!ACH! {S}{*1}I'm hot and cold at the same time…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02ALUTHER_HOWYOUFEEL" : {
      "text" : "!ACI! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02AKARA_HURRY" : {
      "text" : "!ACJ! {S}{*1}Stay with her.{*2}I'll try to find this Markus. {*3}We'll leave as soon as we have passports…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02ALUTHER_HURRY" : {
      "text" : "!ACK! {S}{*1}The last bus is in two hours.{*2}And the terminal's on the other side of town, we haven't got much time. {*3}Kara…{*4}There's something I have to tell you…{*5}It's about Alice…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02AKARA_HURRYK" : {
      "text" : "!ACL! {S}{*1}I'll try to find this Markus.{*2}The last bus leaves in two hours and it's on the other side of town.{*3}We'll go as soon as we have passports.{*4}Will you be ok?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02AKARA_HURRYEND" : {
      "text" : "!ACM! {S}{*1}We'll have lots of time to talk on the bus…{*2}I'll be back.{*3}Stay with Alice.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_INSIDE_INTRO_PC_X02ALUTHER_HURRYEND" : {
      "text" : "!ACN! ",
      "hasLink" : true,
      "linkExists" : true
    }
  },
