    "X0201A_MEET_MARKUS_PC_X02AKARA_HUMANGIRL" : {
      "text" : "!AM4! {S}{*1}Thank you.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_BOND" : {
      "text" : "!AM5! {S}{*1}She needs me.{*2}And I need her.{*3}It's as simple as that…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_DIFFERENCE" : {
      "text" : "!AM6! {S}{*1}I don't care whether she's human or android…{*2}She's just someone who matters to me.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_SECRET" : {
      "text" : "!AM7! {S}{*1}It's a long story.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_LOOKS" : {
      "text" : "!AM8! {S}",
      "hasLink" : true,
      "linkExists" : false
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_LUTHER" : {
      "text" : "!AM9! {S}{*1}I'm with a little girl and another android…{*2}There's a bus leaving for the border in less than two hours, and we need passports…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AMARKUS_SAFE" : {
      "text" : "!AMA! {S}{*1}No, Detroit's under curfew.{*2}There're soldiers everywhere and they're rounding up all the androids and sending them to camps…{*3}Maybe you should {*4}stay here a while.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AKARA_LUTHERDEAD" : {
      "text" : "!AMB! {S}{*1}I'm with a little girl…{*2}There's a bus leaving for the border in less than two hours, and we need passports.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AMARKUS_HUMANGIRLM" : {
      "text" : "!AMC! {S}{*1}One of our people used to work in the State Department.{*2}He has electronic passports he can easily modify.{*3}I’ll have him get them to you.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_MEET_MARKUS_PC_X02AMARKUS_HUMANGIRLASK" : {
      "text" : "!AMD! {S}{*1}You said you’re with a little girl, right?{*2}You know that humans hate us…{*3}Why are you protecting her?",
      "hasLink" : true,
      "linkExists" : true
    },
