  "1769" : {
    "X0201A_TWIST_ALICE_PC_X02AKARA_ALICE" : {
      "text" : "!AMX! {S}{*1}Alice?..",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_TWIST_ALICE_PC_X02AKARA_YOUKNEW" : {
      "text" : "!AMY! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_TWIST_ALICE_PC_X02ALUTHER_YOUKNEW" : {
      "text" : "!AMZ! {S}{*1}You knew from the beginning.{*2}You just didn't want to see it.{*3}She wanted a mom,{*4}and you wanted someone to care for.{*5}You needed each other. {*6}What difference does it make?{*7}Do you love her any less now that you know she's one of us? {*8}Alice loves you Kara.{*9}She loves you more than anything in the world.{*10}She became the little girl you wanted! And you became the mother she needed.{*11}Forgetting who you are,{*12}to become what someone needs you to be...{*13}Maybe that's what it means to be alive.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0201A_TWIST_ALICE_PC_X02ALUCY_YOUKNEWLUCYB" : {
      "text" : "!AN0! {S}{*1}She wanted a mom. {*2}You wanted a little girl. {*3}You needed each other to survive…{*4}In the end, what difference does it make? {*5}Do you love her any less now that you know she's one of us? {*6}Maybe that's what it means to be alive... {*7}Forgetting who we are to become what someone needs us to be.  {*8}She loves you... {*9}She loves you more than anything in the world. {*10}She became the one you wanted her to be. {*11}Out of love for you.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
