  "1778" : {
    "X0203A_BRIDGE_LEADNORTH_PC_X02ASIMON_DYING" : {
      "text" : "!ANH! {S}{*1}President Warren says we’re a threat to national security, we need to be exterminated…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_BRIDGE_LEADNORTH_PC_X02AJOSH_DYING" : {
      "text" : "!ANI! {S}{*1}We're short on blue blood and biocomponents.{*2}Our people are shutting down one after another and there's nothing we can do for them!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_BRIDGE_LEADNORTH_PC_X02AMARLA_DYING" : {
      "text" : "!ANJ! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_BRIDGE_LEADNORTH_PC_X02ASIMON_DYINGEND" : {
      "text" : "!ANK! {S}{*1}Markus would know what to do…{*2}He gave his life for our cause. {*3}At least he fought for us!{*4}I’m on it.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_BRIDGE_LEADNORTH_PC_X02AJOSH_DYINGEND" : {
      "text" : "!ANL! {S}{*1}He’s the one that got us into this mess!{*2}He put us all into danger by provoking humans! How much longer before they find Jericho now?{*3}If you choose a confrontation with humans, we're all going to die. {*4}You’re making a mistake North.{*5}You will not buy our freedom with blood.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_BRIDGE_LEADNORTH_PC_X02AMARLA_DYINGEND" : {
      "text" : "!ANM! {S}{*1}THAT'S ENOUGH! {*2}Markus is gone.{*3}It's up to us now to decide the future of our people. {*4}We have to fight them. {*5}There's no other way. {*6}Gather up all the guns you can find, we leave at dawn.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "2244" : {
    "X0203A_LEADNORTH_SIMONDEAD_PC_X02AJOSH_LASTTALK" : {
      "text" : "!ANN! {S}{*1}We're short of blue blood and biocomponents.{*2}Our people are shutting down one after another and there's nothing we can do for them. {*3}President Warren {*4}is saying we’re a threat to national security and that we need to be eliminated…{*5}He’s the one that got us into this mess!{*6}He provoked the humans! How much longer before they find Jericho now?{*7}Markus is dead,{*8}North.{*9}Now it's up to us {*10}to decide the future for our people. {*11}If you choose a confrontation with humans,{*12}we are all going to die. {*13}This is a mistake, North.{*14}You won’t buy our freedom with blood.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X0203A_LEADNORTH_SIMONDEAD_PC_X02AMARLA_LASTTALK" : {
      "text" : "!ANO! {S}{*1}Markus would know what to do…{*2}He gave his life for our cause!{*3}We have to fight them.{*4}It's the only way. {*5}Gather up all the guns you can find.{*TC:74384|75319}We leave at dawn.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
