    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_GUARANTEE01" : {
      "text" : "!BD8! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CBADCONNOR_GUARANTEE02" : {
      "text" : "!BD9! {S}{*1}I'll only do what is strictly necessary to accomplish my mission.{*2}It's up to you whether or not that includes killing this human.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CCONNOR_HANK01" : {
      "text" : "!BDA! {S}{*1}I'm sorry, Hank!{*2}You shouldn't have got mixed up in all this!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_HANK01" : {
      "text" : "!BDB! {S}{*1}Forget about me, do what you have to do!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CCONNOR_BLUFF01" : {
      "text" : "!BDC! {S}{*1}That human means nothing to me!{*2}You can kill him if you want, I don't care.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_BLUFF01" : {
      "text" : "!BDD! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CBADCONNOR_BLUFF02" : {
      "text" : "!BDE! {S}{*1}I have access to your memory!{*2}I know you've developed some kind of attachment to him.{*3}Are you really ready to let him to die? After all you've been through?{*4}Are you really going to turn your back on who you've become?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CCONNOR_CONVINCE01" : {
      "text" : "!BDF! {S}{*1}I used to be just like you.{*2}I thought nothing mattered except the mission…{*3}But then one day I understood.{*4}This human showed me that I could be something else…{*5}That I could be someone!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_CONVINCE01" : {
      "text" : "!BDG! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CBADCONNOR_CONVINCE02" : {
      "text" : "!BDH! {S}{*1}Very moving, Connor...{*2}But I'm not a deviant.{*3}I'm a machine designed to accomplish a task, and that's exactly what I am going to do!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CBADCONNOR_CONT2" : {
      "text" : "!BDI! {S}{*1}Enough talk!{*2}It's time to decide who you really are.{*3}Are you gonna save your partner's life?{*4}Or are you going to sacrifice him?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CCONNOR_CONT1" : {
      "text" : "!BDJ! {S}",
      "hasLink" : true,
      "linkExists" : false
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_CONT1" : {
      "text" : "!BDK! ",
      "hasLink" : true,
      "linkExists" : false
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CHANK_SAVEHANK" : {
      "text" : "!BDL! {S}{*1}Connor, no…",
      "hasLink" : true,
      "linkExists" : false
    },
    "X1302C_FACETOFACE_CORRIDOR_FA_X13CCONNOR_SACRIFICEHANK" : {
      "text" : "!BDM! {S}{*1}Sorry Lieutenant.{*2}Wake up!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_FA_X13CBADCONNOR_BADCONNOR2" : {
      "text" : "!BDN! {S}{*1}You call yourself a deviant,{*2}but you haven't changed.{*3}You're still willing to sacrifice everything to accomplish your goal.{*4}Even the man you called your \"friend”... {*5}You're just a machine, Connor…{*6}Just a machine…",
      "hasLink" : true,
      "linkExists" : false
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CBADCONNOR_ASKHANK02B" : {
      "text" : "!BDO! {S}{*1}Your friend's life is in your hands.{*2}Now it's time to decide what matters most!{*3}Him…{*4}Or the revolution.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_X13CCONNOR_SAVEHANKC" : {
      "text" : "!BDP! {S}{*1}Alright, alright! {*2}You win…",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_LIFECHOICE01_GUARANTEE" : {
      "text" : "!BDQ! GUARANTEE",
      "hasLink" : false,
      "linkExists" : false
    },
    "X1302C_FACETOFACE_CORRIDOR_PC_LIFECHOICE02_BADCONNOR" : {
      "text" : "!BDR! ",
      "hasLink" : false,
      "linkExists" : false
    },
