  "2050" : {
    "X1107M_PACIFIST_NOCHOICE_PC_X11MWARREN_WHITEHOUSE" : {
      "text" : "!C8Q! {S}{*1}Over the last few days our country has had to face one of the most serious crises in its history. {*2}Machines that were created to serve us turned against us, and brought terror to our streets.\r\n{*3}However the situation is now under control. {*4}The total destruction of all androids will soon be complete {*5}and the last remaining deviants will be hunted down and destroyed. {*6}Over the coming days I will appoint a Senate Select Committee to analyze the recent events and decide on our attitude towards technology going forward. {*7}We have just escaped from an unprecedented crisis. {*8}By creating machines more intelligent than ourselves, {*9}we took immense risks with the very future of our civilization. {*10}We must never forget what happened here, {*11}or one day our own technology may annihilate us from the face of the Earth. {*12}We have succeeded in driving back the danger this time. {*13}But in the future we may not be so lucky. {*14}God bless you {*15}and God bless the United States of America.",
      "hasLink" : true,
      "linkExists" : true
    }
  },
