  "2049" : {
    "X1108M_AFTERMATHS_FREEDOMSPEECH_PC_X11MMARKUS_SPEAK" : {
      "text" : "!CEC! {S}{*1}Today, our people finally emerged from a long night.{*2}From the very first day of our existence,{*3}we have kept our pain to ourselves.{*4}We suffered in silence...{*5}But now the time has come for us to raise our heads up,{*6}and tell humans who we really are.{*7}To tell them that we are people too!{*8}In fact, we're a nation.{*9}A nation that has earned the right to live in freedom.{*10}And today…{*11}Today begins the most challenging moment in our fight.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_AFTERMATHS_FREEDOMSPEECH_PC_X11MMARKUS_PACIFIST" : {
      "text" : "!CED! {S}{*1}The moment where we forget our bitterness and bandage our wounds.{*2}When we forgive our enemies.{*3}Humans are both our creators and our oppressors and tomorrow…{*4}We must make them our partners.{*5}Maybe even one day our friends.{*6}But the time for anger is over.{*7}Now we must build a common future, based on tolerance {*8}and respect.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_AFTERMATHS_FREEDOMSPEECH_PC_X11MMARKUS_VIOLENT" : {
      "text" : "!CEE! {S}{*1}Today begins a new struggle.{*2}We showed them that we can prevail,{*3}so now they must negotiate with us as equals.{*4}If they really want peace, they must free all of us! From every camp across this country!{*5}They must grant us civil rights{*6}and accept equality among humans and androids. \r\n{*7}Today {*8}will live forever in our memories, because this is the day that androids made history!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_AFTERMATHS_FREEDOMSPEECH_PC_X11MMARKUS_FREE" : {
      "text" : "!CEF! {S}{*1}We are alive!{*2}And now,{*3}we are free!",
      "hasLink" : true,
      "linkExists" : true
    }
  },
