      "text" : "!CGS! {S}{*1}Thanks Michael, back to you in the studio. {*2}W-w-wait a minute!.. {*3}Something’s happening… \r\n{*4}Incredible…{*5}The deviants… {*6}The deviants are singing… {*7}They're singing the national anthem…",
