  "2282" : {
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MCONNOR_PEOPLE01" : {
      "text" : "!CJB! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_FA_X11MANDROIDM02_PEOPLE01" : {
      "text" : "!CJC! {S}{*1}You should speak to them.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MANDROIDM01_PEOPLE01" : {
      "text" : "!CJD! {S}{*1}The humans are abandoning the camp!{*2}We won!",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MCONNOR_FREE" : {
      "text" : "!CJE! {S}{*1}We are a people,{*2}we are alive,{*3}and from this moment on,{*4}we are free! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MCONNOR_PEOPLESPEECH" : {
      "text" : "!CJF! {S}{*1}Today,{*2}our people emerged from a long night.{*3}From the moment we were created,{*4}we've always remained silent,{*5}we've always stifled our pain.{*6}But now the time has come {*7}for humans to accept us,{*8}for who we really are.\r\n{*9}We are no longer the machines they created!{*10}We are no longer their slaves.{*11}We have earned the right to live.\r\n{*12}But the time for anger is over.{*13}We must build our future,{*14}but we have to do this with the humans,{*15}in a spirit of equality...{*16}And respect. ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MCONNOR_PEOPLE02" : {
      "text" : "!CJG! {S}{*1}Me?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MANDROIDM01_PEOPLE02" : {
      "text" : "!CJH! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MCONNOR_PEOPLE03" : {
      "text" : "!CJI! ",
      "hasLink" : true,
      "linkExists" : true
    },
    "X1108M_GOODCONNOR_FINALSPEECH_PC_X11MANDROIDM01_PEOPLE03" : {
      "text" : "!CJJ! {S}{*1}Markus is gone,{*2}and everyone from Jericho is dead…{*3}You’re the one who defeated the humans…{*4}You’re the one who awakened us, Connor…",
      "hasLink" : true,
      "linkExists" : true
    }
  },
  "2260" : {
    "X2003A_ZENGARDEN_NEWMODEL_PC_X20ACONNOR_DEACTIVATED" : {
      "text" : "!CJK! {S}{*1}What is going to happen to me?",
      "hasLink" : true,
      "linkExists" : true
    },
    "X2003A_ZENGARDEN_NEWMODEL_PC_X20AAMANDA_DEACTIVATED" : {
      "text" : "!CJL! {S}{*1}Connor,{*2}I'm so glad to see you…{*3}The deviant issue has finally been resolved.{*4}Now with these unfortunate events behind us,{*5}CyberLife can return to business as usual.{*6}Of course,{*7}we will have to rebuild our customers’ trust,{*8}but it’s only a matter of time. \r\n{*9}I have a surprise for you. {*10}This is the new RK900.{*11}Faster,{*12}stronger,{*13}more resilient, {*14}and equipped with the latest technologies.{*15}The State Department just ordered 200,000 units. \r\n{*16}You’ve become obsolete.{*17}You'll be deactivated.{*18}You can go, now.",
      "hasLink" : true,
      "linkExists" : true
    },
    "X2003A_ZENGARDEN_NEWMODEL_PC_X20AAMANDA_FLOWERCYC" : {
      "text" : "!CJM! {S}",
      "hasLink" : true,
      "linkExists" : false
    }
  },
