      "text" : "!E2P! {S}{*1}Following the android crisis and the neutralization of all military androids, American forces in the Arctic have been forced to withdraw, leaving the way clear for the Russian army.{*2}But according to some sources, the Russian forces also seem mysteriously to have withdrawn.{*3}The Kremlin has made no comment for the moment but it is quite possible that the Russian army has been confronted with a similar crisis among its own androids.\r\n{*4}The Chairman of the United Nations, Douglas Cornwell, has called for the organization of an international conference on the status of the Arctic.{*5}In any case, the danger of a third world war seems to have been ruled out... for the moment.",
